import React, { useState } from 'react';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './AgencyRegister.css';
import LoginImage from '../../../Assets/5805585.jpg';
import { MDBIcon } from 'mdb-react-ui-kit';


const AgencyRegister = () => {
  const [userDTO, setUserDTO] = useState({
    firstName: '',
    lastName: '',
    username: '',
    email: '',
    password: '',
    role: 'User',
  });
  const [success, setSuccess] = useState(false);
  const [errors, setErrors] = useState({
    firstName: '',
    email: '',
    phoneNumber: '',
    password: '',
  });

  const validateEmail = (email) => {
    return /^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email);
  };

  const validatePassword = (password) => {
    // Password regex pattern: At least one uppercase, one lowercase, one number, and one special character
    const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/;
    return passwordRegex.test(password);
  };

  const validatePhoneNumber = (phoneNumber) => {
    return /^\d{0,14}$/.test(phoneNumber);
  };

  const register = () => {
    const newErrors = {
      firstName:
        userDTO.firstName.trim() === ''
          ? 'First name is required'
          : userDTO.firstName.trim().length < 5 || userDTO.firstName.trim().length > 20
            ? 'First name must be between 5 and 20 characters'
            : '',
      email: userDTO.email.trim() === '' ? 'Email is required' : validateEmail(userDTO.email) ? '' : 'Invalid email',
      phoneNumber:
        userDTO.username.trim() === ''
          ? 'Phone number is required'
          : !validatePhoneNumber(userDTO.username)
            ? 'Invalid phone number (only numbers allowed, max 14 digits)'
            : '',
      password:
        userDTO.password.trim() === ''
          ? 'Password is required'
          : validatePassword(userDTO.password)
            ? ''
            : 'Password must contain at least one uppercase, one lowercase, one number, and one special character',
    };

    setErrors(newErrors);

    if (Object.values(newErrors).every((error) => error === '')) {
      console.log(userDTO);
      fetch('https://localhost:7190/api/Owner/register', {
        method: 'POST',
        headers: {
          accept: 'text/plain',
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(userDTO),
      })
        .then(async (data) => {
          if (data.status === 200) {
            var user = await data.json();
            setSuccess(true);
            toast.success('Registered successfully!');
          }
        })
        .catch((error) => {
          console.error('Error:', error);
          toast.error('Registration failed!');
        });
    }
  };

  return (
    <div className='containers'>
      <div className='split'>
        <div className='split1'>
          <div className='head'>Sign Up</div>
          <div>
            {/* 1st Row */}
            <div className='flexprop'>
              <div>
                <div className='flex'>
                  <div>
                    <MDBIcon fas icon="user" size='lg' />
